    <React.Fragment>
      <Grid
        container
        sx={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          padding: "1rem",
        }}
      >
        <Grid item xs={12} sm={4}>
          <Paper elevation={4}></Paper>
          <Box>
            <Typography variant="h6">BASIC</Typography>
          </Box>
          <Box></Box>
          <Box></Box>
        </Grid>
        <Grid item xs={12} sm={4}></Grid>
        <Grid item xs={12} sm={4}></Grid>
      </Grid>
    </React.Fragment>
  );
};

